func getBaas20ABIStr(tt string) string {
	switch {
	case tt == "1":
		return Baas20StandardABI
	case tt == "2":
		return Baas20BurnPauseABI
	case tt == "3":
		return Baas20BurnPauseMintABI
	case tt == "4":
		return Baas20BurnPauseMintCapABI
	default:
		return Baas20StandardABI
	}

}

func getBaas20ABI(tt string) (abi.ABI,error) {
	Abi, err := abi.JSON(strings.NewReader(getBaas20ABIStr(tt)))
	if err != nil {
		fmt.Println("erc20 abi parse failed,please check... ")
		return abi.ABI{}, fmt.Errorf("abi error")
	}
	return Abi,err
	
}

func getBaas20Code(tt string) []byte {
	switch {
	case tt == "1":
		ab, _ := hex.DecodeString(Baas20BaseCode)
		return ab
	case tt == "2":
		ab, _ := hex.DecodeString(Baas20BurnPauseCode)
		return ab
	case tt == "3":
		ab, _ := hex.DecodeString(Baas20BurnPauseMintCode)
		return ab
	case tt == "4":
		ab, _ := hex.DecodeString(Baas20BurnPauseMintCapCode)
		return ab
	default:
		ab, _ := hex.DecodeString(Baas20BaseCode)
		return ab
	}

}
